  true,\n\t\"url\": null,\n\t\"notes\": \"This report is the 45th in the series and
  describes San Franciscoufffdu06eas housing supply. Housing Inventory data accounts
  for new housing construction, demolitions, and alterations in a consistent format
  for analysis of housing production trends. Net housing unit gains are reported citywide,
  by zoning classification, and by planning district. Other areas covered include
  affordable housing production, condominium conversions, and changes to the residential
  hotel stock. In addition, lists of major housing projects completed and approved
  for construction in 2014 are provided. A list of affordable housing projects in
  the pipeline (projects in various stages of review or pre-construction planning)
  is included to provide a picture of likely housing construction activity in the
  near future.rnExternal Link\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
